n = int(input())
a = [list(map(int, input().split())) for i in range(n)]

a = [l - 1 for l in a]
a = [(l, r) for l, r in a]
a = sorted(a)

start = -1
end = -1

for i in range(n):
	l, r = a[i]
	if l < start:
		start = l
	if r > end:
		end = r
	if l > end:
		break

if start == -1:
	print(-1 - 1)
else:
	print(start + 1)
